App.controller("calculatorController",["$scope",function($scope){var current="";$scope.equal=function(){current=eval(current)+Math.PI,$scope.output=current},$scope.opBtn=function(a){current+=a,$scope.output=current},$scope.numBtn=function(a){current+=a,$scope.output=current},$scope.clear=function(){current="",$scope.output=current}}]);